const Cake = ({ props }) => {

  return (
    <>
      <h2>{props.cakeName}</h2>
      <p>Price: ${props.price}</p>
      <p>Rating: {props.rating} stars</p>
      <h3>Ingredients:</h3>
      <ul>
        {props.ingredients.map((ingredient, index) => (
          <li key={index}>{ingredient}</li>
        ))}
      </ul>
    </>
  )
}

export default Cake;
